import React from "react";
import axios from "axios";



export default class Axios extends React.Component {
  state = {
    city: []
  }

  componentDidMount() {
    axios.get(`http://localhost:2500/importantCities`)
      .then(res => {
        const city = res.data;
        this.setState({ city });
      })
  }

  render() {
    return (
      <ul>
        { this.state.city.map(city=> <div><li>{city.name}</li> <li>{city.country}</li></div>)}


      </ul>
    )
  }
}
